Ludzie, z którymi nie ma rzeczy niemożliwych.

Dziękuję Wam
Jarek za postawienie dzielnicy od zera w półtora tygodnia (!), za każdą chwilę wspólnego 'podpierania ścian' i za wszystkie krople krwi, potu i łez, które te ściany wchłonęły
@gabriel_piotrowski za bounce dniami i nocami, za nieokazywanie paniki przy moich kilometrowych rozpiskach, i za bycie ogromnym wsparciem - podobnie jak @w_bochat
@yamahu za anielską cierpliwość i za to, że nas tą taśmą do mikroportów nie kneblowałeś
@m_sambaa za podkreślenie, jak bardzo się zestarzałam przy tej produkcji
I wszystkim szaleńcom z naszej grupy Hiznits za to, czego dokonaliśmy!

